import { ReactNode } from 'react';
import { Banner, Cell, IconContainer, Section } from '@telegram-apps/telegram-ui';

import { Icon28Chat } from '@telegram-apps/telegram-ui/dist/icons/28/chat';

type CellProps = {
    id: number;
    icon: ReactNode;
    title: string;
    subhead: string,
}

const cell: CellProps = {
    id: 1,
    icon: <Icon28Chat />,
    title: 'Петров Иван Федорович',
    subhead: 'Б24-215',
}

export const MainProfileBanner = () => (
    <Section>
        <Banner
            key={cell.id}
            before={<IconContainer>{cell.icon}</IconContainer>}
            header={cell.title}
            subheader={cell.subhead}
        >

        </Banner>
        )
    </Section >
);
